import React from 'react';
import './style.css';
import thumbDown from './images/thumb-down.svg'; // 실제 이미지 경로로 업데이트
import thumbUp from './images/thumb-up.svg';     // 실제 이미지 경로로 업데이트

export default function LikeDislike({downRate, upRate}) {
  downRate = 33;
  upRate = 55;
  return (
    <div className="rate">
      <div className="item">
        <img src={thumbDown} alt="Thumb Down" />
        <p>{downRate}</p>
      </div>
      <div className="item">
        <img src={thumbUp} alt="Thumb Up" />
        <p>{upRate}</p>
      </div>
    </div>
  );
}
